import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import {Typography} from "@material-ui/core";
import Container from "@material-ui/core/Container";
import {makeStyles} from "@material-ui/core/styles";
import profilePhoto from "../images/myPhotoBlackWhite.png"
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";

const useStyles = makeStyles((theme) => ({
    sectionWeb: {
        display: 'none',
        [theme.breakpoints.up('md')]: {
            display: 'flex',
        },
    },
    sectionMobile: {
        display: 'flex',
        [theme.breakpoints.up('md')]: {
            display: 'none',
        },
    },
    cover: {
        width: 151,
    },
}));

function App() {
    const classes = useStyles();

    return (
        <div>
            <ApplicationBar/>
            <Container className={classes.sectionWeb} style={{border: 'red solid 1px'}}>
                <div id="box1"></div>
                <div id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </div>
                </div>
            </Container>
            <Card className={classes.root}>
                <div className={classes.details}>
                    <CardContent className={classes.content}>
                        <Typography component="h5" variant="h5">
                            Live From Space
                        </Typography>
                        <Typography variant="subtitle1" color="textSecondary">
                            Mac Miller
                        </Typography>
                    </CardContent>
                </div>
                <CardMedia
                    className={classes.cover}
                    image={profilePhoto}
                    title="Live from space album cover"
                />
            </Card>
        </div>
    );
}

export default App;


